import React from "react";

import { useState, useEffect } from "react";
import {
  RadioGroup,
  FormControl,
  FormLabel,
  Button,
  Radio,
  Sheet,
  Input,
  Box,
  Typography,
} from "@mui/joy";

function pageOne({ setQuizStep, quizStep }) {
  // eslint-disable-next-line react-hooks/rules-of-hooks
  const [values, setValues] = useState({
    name: localStorage.getItem("byte_name"),
    age: localStorage.getItem("byte_age"),
    height_feet: localStorage.getItem("byte_height_feet"),
    height_inches: localStorage.getItem("byte_height_inches"),
    weight: localStorage.getItem("byte_weight"),
    goal: localStorage.getItem("byte_goal"),
    activity: localStorage.getItem("byte_activity"),
  });

  // eslint-disable-next-line react-hooks/rules-of-hooks
  useEffect(() => {
    console.log(values);
  }, [values]);
  const handleChange = (e) => {
    let updatedValue = {};
    if (e.target.id === "activity") {
      updatedValue = {
        [e.target.id]:
          e.target.value.title + " with " + e.target.value.description,
      };
    } else {
      updatedValue = { [e.target.id]: e.target.value };
    }

    setValues((values) => ({
      ...values,
      ...updatedValue,
    }));
  };
  return (
    <div className="w-[40rem]">
      <div className="flex flex-col gap-3">
        <div aria-label="name-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>First Name</FormLabel>
          <Input
            id="name"
            defaultValue={values.name}
            onChange={(e) => {
              handleChange(e);
            }}
          />
        </div>
        <div className="flex gap-8">
          <div className="flex gap-2">
            <div>
              <FormLabel aria-label="age-question" sx={{ fontSize: "1.3em" }}>
                Age
              </FormLabel>
              <Input
                id="age"
                type="number"
                aria-label="age-question"
                defaultValue={values.age}
                onChange={(e) => {
                  handleChange(e);
                }}
                slotProps={{
                  input: {
                    min: 0,
                    max: 116,
                    step: 1,
                  },
                }}
              />
            </div>
            <div>
              <FormLabel sx={{ fontSize: "1.3em" }}>Weight</FormLabel>
              <Input
                id="weight"
                type="number"
                aria-label="weight-question"
                defaultValue={values.weight}
                onChange={(e) => {
                  handleChange(e);
                }}
                slotProps={{
                  input: {
                    min: 0,
                    max: 1000,
                    step: 1,
                  },
                }}
                endDecorator={<div>lbs</div>}
              />
            </div>
          </div>
          <div className="flex gap-2">
            <div>
              <FormLabel aria-label="age-question" sx={{ fontSize: "1.3em" }}>
                Height
              </FormLabel>
              <div className="flex">
                <Input
                  id="height_feet"
                  type="number"
                  aria-label="height-feet-question"
                  onChange={(e) => {
                    handleChange(e);
                  }}
                  defaultValue={values.height_feet}
                  endDecorator={<div>ft</div>}
                  slotProps={{
                    input: {
                      min: 0,
                      max: 116,
                      step: 1,
                    },
                  }}
                />
                <div>
                  <Input
                    id="height_inches"
                    type="number"
                    aria-label="height-inches-question"
                    onChange={(e) => {
                      handleChange(e);
                    }}
                    defaultValue={values.height_inches}
                    slotProps={{
                      input: {
                        min: 0,
                        max: 1000,
                        step: 1,
                      },
                    }}
                    endDecorator={<div>in</div>}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>

        <div aria-label="goal-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>What is your goals?</FormLabel>
          <RadioGroup
            aria-labelledby="goal-label"
            defaultValue={null}
            size="lg"
          >
            <div className="flex justify-between text-center">
              {["Lose Weight", "Maintain Weight", "Gain Weight"].map(
                (value) => (
                  <Sheet
                    key={value}
                    sx={{
                      p: 2,
                      borderRadius: "md",
                      boxShadow: "sm",
                      width: "30%",
                    }}
                  >
                    <Radio
                      id="goal"
                      label={`${value}`}
                      aria-label={`select-${value}`}
                      overlay
                      disableIcon
                      value={value}
                      onClick={(e) => {
                        handleChange(e);
                      }}
                    />
                  </Sheet>
                )
              )}
            </div>
          </RadioGroup>
        </div>

        <div aria-label="activity-level-question">
          <FormLabel sx={{ fontSize: "1.3em" }}>
            What is your level of physical activity?
          </FormLabel>
          <RadioGroup
            aria-labelledby="goal-label"
            defaultValue={null}
            size="lg"
          >
            <div className="flex justify-between text-center">
              {[
                { title: "Sedentary", description: "Little or no exercise" },
                {
                  title: "Moderately Active",
                  description: "Moderate exercise 3-5 days a week",
                },
                {
                  title: "Very Active",
                  description: "Hard exercise 6-7 days a week",
                },
              ].map((value) => (
                <Sheet
                  key={value}
                  sx={{
                    p: 2,
                    borderRadius: "md",
                    boxShadow: "sm",
                    width: "30%",
                  }}
                >
                  <Radio
                    id="activity"
                    label={`${value.title}`}
                    aria-label={`select-${value.title}`}
                    overlay
                    disableIcon
                    value={value}
                    onClick={(e) => {
                      handleChange(e);
                    }}
                  />
                  <Typography>{value.description}</Typography>
                </Sheet>
              ))}
            </div>
          </RadioGroup>
        </div>

        <div className="w-full flex justify-between">
          <Button
            variant="soft"
            aria-label="previous-page-button"
            onClick={() => {
              setQuizStep(null);
            }}
          >
            Previous
          </Button>
          <Button
            variant="soft"
            aria-label="next-page-button"
            onClick={() => {
              setQuizStep(quizStep + 1);
            }}
          >
            Next
          </Button>
        </div>
      </div>
    </div>
  );
}

export default pageOne;
